import React from 'react';
import logo from './logo.svg';
import './App.css';

// alert('Let start')

function App() {
  return (
    <div>
      <h1><AppTitle /></h1>
      <DropList />
      <Rating />
    </div>
  );
}

function AppTitle() {
  return (
    <React.Fragment>This is APP</React.Fragment>
  )
}

function DropList() {
  return (
    <div>
      <DropListTitle />
      <DropListBody />
    </div>
  )
}

function DropListTitle() {
  return (
    <><h3>Drop List Title</h3></>
  )
}

function DropListBody() {
  return (
    <ul>
      <li>iOne</li>
      <li>Two</li>
      <li>Three</li>
    </ul>
  )
}

function Rating() {
  return (
    <div>
      <Star />
      <Star />
      <Star />
      <Star />
      <Star />
    </div>
  )
}


function Star() {
  return (
    <div><em>STAR</em></div>
  )
}

export default App;
